import logo from './logo.svg';
import './App.scss';

import {
  Container, Row, Col, Nav, Navbar
} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar bg="dark" expand="lg">
        <Navbar.Brand href="#home">Mohamed Elhamdadi</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav"/>
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#research">Research &amp; Publications</Nav.Link>
            <Nav.Link href="#classes">Classes</Nav.Link>
            <Nav.Link href="#students">Postdocs &amp; Students</Nav.Link>
            <Nav.Link href="#cv">CV</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      <Container>

        <Row>
          <Col xs={12} sm={12} md={12} lg={8} xl={8}>
            <h1>Mohamed Elhamdadi</h1>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
